import React from 'react';
import { FormProvider, useForm } from 'react-hook-form';
import Form from './form-reusable';

export default function PersonalHistory(props) {
    const methods=useForm();

  return <FormProvider {...methods}>
    <form className='container' id='form-personal' onSubmit={methods.handleSubmit(props.onSubmit)}>
    <div className='row'>
    <div className='col-xs-12 col-sm-6 col-lg-4'></div>

    </div>
    </form>
  </FormProvider>;
}
